            r"\bfree\b", r"\bclaim\b", r"\bclick here\b", r"\blimited time\b", r"\bdeal\b",
            r"\boffer\b", r"\bexclusive\b", r"\bwin\b", r"\bwinner\b", r"\bcongratulations\b",
            r"\bguarantee\b", r"\bprize\b", r"\bnow\b", r"\bact now\b", r"\burgent\b",
            r"\bbonus\b", r"\bcash\b", r"\biphone\b", r"\bgift\b", r"\bdiscount\b"
        ]
        hits = sum(1 for pat in spam_terms if re.search(pat, t))
        score += min(0.45, hits * 0.08)

        # Excess punctuation / shouty text
        excls = count_exclaim(orig)
        if excls >= 3:
            score += 0.10
        if re.search(r"\b[A-Z]{5,}\b", orig):
