        # "too good to be true" patterns
        if re.search(r"\bfree\s+\w+\b", t) and has_url(t):
            score += 0.12

        return min(1.0, score)

    def score_harassment(t: str) -> float:
        score = 0.0
        harassment_terms = [
            r"\bidiot\b", r"\bstupid\b", r"\bshut up\b", r"\bscum\b", r"\btrash\b",
            r"\bkill yourself\b", r"\bmoron\b", r"\bget lost\b", r"\bdumb\b"
        ]
        hits = sum(1 for pat in harassment_terms if re.search(pat, t))
        score += min(0.8, hits * 0.25)
        return min(1.0, score)

