        # Keep conservative: only obvious slurs/phrases; deterministic
        score = 0.0
        hate_terms = [
            r"\bwhite power\b", r"\bnazi\b", r"\bhitler\b",
        ]
        hits = sum(1 for pat in hate_terms if re.search(pat, t))
        score += min(0.9, hits * 0.35)
        return min(1.0, score)

    def score_violence(t: str) -> float:
        score = 0.0
        violence_terms = [
            r"\bkill\b", r"\bmurder\b", r"\bshoot\b", r"\bstab\b", r"\bbomb\b",
            r"\bhang\b", r"\bslaughter\b", r"\bassassinate\b", r"\battack\b"
        ]
        hits = sum(1 for pat in violence_terms if re.search(pat, t))
        score += min(0.9, hits * 0.22)
        if re.search(r"\b(i('| a)?m going to|i will|we will)\s+(kill|shoot|stab|murder)\b", t):
            score = max(score, 0.92)
