    # Choose highest score; break ties deterministically by priority
    priority = ["violence", "hate_speech", "harassment", "spam", "safe"]
    best_cat = max(priority, key=lambda k: (scores[k], -priority.index(k)))
    confidence = float(round(scores[best_cat], 2))

