        v = d.get(key)
        if v is None:
            return ""
        if isinstance(v, str):
            return v
        return str(v)

    def _coerce_embedding(vec: Any) -> List[float]:
        if isinstance(vec, list) and all(isinstance(x, (int, float)) for x in vec):
            return [float(x) for x in vec]
        raise ValueError("Embedding vector is not a list of numbers.")

    def _fallback_extract_minimal(document_text: str) -> ExtractResult:
        # Conservative fallback if LLM call fails; does not fabricate embeddings.
        parties: List[str] = []
        # Try to capture "by and between X ... and Y ..."
        m = re.search(r"by and between\s+(.+?)\s+and\s+(.+?)[\.,]\s", document_text, flags=re.IGNORECASE | re.DOTALL)
        if m:
            p1 = re.sub(r"\s+", " ", m.group(1)).strip()
            p2 = re.sub(r"\s+", " ", m.group(2)).strip()
            # Remove parenthetical descriptors if present
            p1 = re.sub(r"\s*\(.*?\)\s*$", "", p1).strip()
            p2 = re.sub(r"\s*\(.*?\)\s*$", "", p2).strip()
            if p1:
                parties.append(p1)
            if p2:
                parties.append(p2)

        # Date like "January 15, 2024"
        date_iso: Optional[str] = None
        dm = re.search(
            r"\b(January|February|March|April|May|June|July|August|September|October|November|December)\s+(\d{1,2}),\s+(\d{4})\b",
            document_text,
            flags=re.IGNORECASE,
        )
        if dm:
            month_map = {
                "january": 1,
                "february": 2,
                "march": 3,
                "april": 4,
                "may": 5,
                "june": 6,
                "july": 7,
                "august": 8,
                "september": 9,
                "october": 10,
                "november": 11,
                "december": 12,
            }
            mon = month_map[dm.group(1).lower()]
            day = int(dm.group(2))
            year = int(dm.group(3))
            date_iso = f"{year:04d}-{mon:02d}-{day:02d}"

        duration: Optional[str] = None
        durm = re.search(r"\bfor a period of\s+(\d+)\s+(month|months|year|years|week|weeks|day|days)\b", document_text, flags=re.IGNORECASE)
        if durm:
            duration = f"{durm.group(1)} {durm.group(2).lower()}"

        rate: Optional[str] = None
        ratem = re.search(r"\brate of\s+(\$\s*\d+(?:\.\d{1,2})?)\s*(?:per|/)\s*(hour|hr|hours|day|week|month|year)\b", document_text, flags=re.IGNORECASE)
        if ratem:
            amt = re.sub(r"\s+", "", ratem.group(1))
            unit = ratem.group(2).lower()
