            if rate:
                parts.append(f"Rate: {rate}")
            summary = "; ".join(parts) + "."

        return {
            "summary": summary,
            "entities": {
                "parties": parties,
                "date": date_iso,
                "contract_type": contract_type,
                "duration": duration,
                "rate": rate,
